import Home from "./home/home.js";
import Form from "./form/form.js";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
function App() {

  return (
    <div id="pag">
      <Router>

        <Switch>
        <Route path="/form" component={Form}></Route>
          <Route path="/" component={Home}></Route>
        </Switch>

      </Router>
    </div>
  );
}

export default App;
